import React from 'react'
import Auxiliary from '../../../hoc/Auxiliary/Auxiliary'

const Label = props => {
    return (
        <Auxiliary>
            <label key={props.index} className='label'>
                {props.label}
            </label><br />
        </Auxiliary>
    )
}

export default Label
